//Validation for a Multi question with several Open End boxes to make first box madatory
function ValMultiOpen(qid)
{
if(!f(qid)['1'].toBoolean())
{
RaiseError();
ClearErrorMessage();
ClearQuestionErrorMessage();
AppendQuestionErrorMessage(LangIDs.en,"Please provide an answer at least for the first box.");
}
}

//Validation for MultiSelect Questions
function MultiRequired()
{
  if(!f(CurrentForm()).toBoolean()) //no answer on current question
  {
    RaiseError();
    ClearErrorMessage();
    ClearQuestionErrorMessage();
    AppendQuestionErrorMessage(9,"Please select an answer.");
    AppendQuestionErrorMessage(12,"Sélectionnez une réponse.");   //FR
    AppendQuestionErrorMessage(16,"Vi preghiamo di selezionare una risposta.");  //IT
    AppendQuestionErrorMessage(2067,"Selecteer een antwoord.");  //Dutch Belgium
    AppendQuestionErrorMessage(2060,"Sélectionnez une réponse.");   //French Belgium

  }
}

