//Validation for Grid Questions
function GridVal(qid)
{
var arr=f(qid).domainValues();
var str="";
var arrstr=new Array();
var strcnt:int =0;
var flag:int =1;
for(var i=0;i<arr.length;i++)
{
if(!f(qid)[arr[i]].toBoolean())
{
flag=0;
arrstr[strcnt]=f(qid)[arr[i]].label();
strcnt=strcnt+1;
arrstr[strcnt]=", ";
strcnt=strcnt+1;
}
}

for(var u=0;u<arrstr.length-1;u++)
{
str=str+arrstr[u];
}

if(arrstr.length > 2)
{
  str=str.substring(0,str.lastIndexOf(",")) + " and " + str.substring(str.lastIndexOf(",")+1,str.length);
}


if(flag==0)
{
RaiseError();
ClearErrorMessage();
ClearQuestionErrorMessage();
AppendQuestionErrorMessage(9,"Please select an answer for "+str);
AppendQuestionErrorMessage(2060,"Please select an answer for "+str); //fr_belg
}
}

// A function to clear the contents of any form.
// then refer to function in script node e.g. - ClearForm(f('Q1'));
//        for clearing other specify data add - ClearForm(f('Q1_98_other'));


function ClearForm(form)
{
 if(form.COMPOUND)
 {
  var fcodes = form.domainValues();
  for(var i=0;i<fcodes.length;i++)
  {
   form[fcodes[i]].set(null);
  }
 }
 else
 {
  form.set(null);
 }
}

