function EndTime()
{
            if (!f('End').toBoolean())
            {
                        f("End").set(new Date());
            }
            var exit  = new Date();
            var timeDif=(exit.getTime()-InterviewStart().getTime())/1000;
            var sec1=Math.floor(timeDif%60);
            var min1=Math.floor(timeDif/60);
            var min2=Math.floor(min1%60);
            var hrs1=Math.floor(min1/60);
            var tdiff=hrs1+":"+min2+":"+sec1;

            ////////////////////////////////////////////////////
            var finalmin=0;
            finalmin+=min2;

            var finalsec=sec1/60;
            finalmin+=finalsec;

            var finalhrs=hrs1*60;
            finalmin+=finalhrs;

            f('Duramin').set(finalmin);
            ////////////////////////////////////////////////////

            f('Duration').set(tdiff);
}

