function linkcreater() {



  // extract current URL components

  var script   = Request.ServerVariables("SCRIPT_NAME");

  var qs       = Request.ServerVariables("QUERY_STRING");

  var hostname = Request.ServerVariables("SERVER_NAME");


var arrqs=qs.split("&")

  // construct new query string components

  var lqs = "l="+ CurrentLang();

  var rqs = "&r="+ CurrentID();

  var sqs = "&s="+ CurrentSID();

  var qid = "&__qid";



  // remove all prior occurances of "r", "s" and "__qid" params
  qs = qs.replace( /&?l=(?:[^&]*)/, "");

  qs = qs.replace( /&?r=(?:[^&]*)/, "");

  qs = qs.replace( /&?s=(?:[^&]*)/, "");

  qs = qs.replace( /&?__qid(?:=[^&]*)?/, "");



  // build new query string

  if (qs.length > 0)

    qs = '&' + qs;

  qs = lqs + rqs + sqs + qid + qs;


  // quick fix: remove consecutive occurrences of ampersands, also 

  // leading and trailing ones

  qs = qs.replace( /&&+/g, "&" );

  qs = qs.replace( /^&/, "" );

  qs = qs.replace( /&$/, "" );


//Response.Write("eLink: "+f("eLink").get()+"<br>");

  var targetURL = "http://" + hostname + script + "?" + qs;

  if(!f("eLink").toBoolean())
  {
  var str = "http://" + hostname + script + "?" + qs;
  //Response.Write(str+"<br>");
  f("eLink").set(str);
  }

    //Response.Write(targetURL+"<br>");



  return targetURL;
}

