function terminateQS2a()
{
var flag=false;

	if(maskQS2a().size()==2)
	{
	if(f("QS2a")[1].any('2') && f("QS2a")[2].any('2'))
		{
		flag= true;
		}
	}

	if(maskQS2a().size()==1)
	{
	if(( f("QS2a")[1].any('2') && f("QS2a")[1].toBoolean() ) || (f("QS2a")[2].any('2') && f("QS2a")[2].toBoolean()))
		{
		flag= true;
		}
	}

return flag;
}

