function maskQGP4a()
{
var s = new Set();

s = a("QGD5a").diff(set('5'));

var code = s.members();

for(var i = 0; i<code.length;i++)
{
	if(f("QGD5a")[code[i]].any('1'))
	{
		s.remove(code[i]);
	}
}

if(f("HidEurope").any('1') || f('co').any('14'))
{
s.remove(3);
}

return s;
}

