function maskQGP6a()
{
var s = new Set();
s = a("QGP6a")
var count =5 ;

if(f("QGD5a")[1].any('1'))
{
s= s.diff(set(1,5,9,13,17));
count--;
}

if(f("QGD5a")[2].any('1'))
{
s= s.diff(set(2,6,10,14,18));
count--;
}

if(f("QGD5a")[3].any('1') || f("HidEurope").any('1') || f('co').any('14'))
 {
 s= s.diff(set(3,7,11,15,19));
count--;
 }

if(f("QGD5a")[4].any('1'))
{
s= s.diff(set(4,8,12,16,20));
count--;
}

f("hidQGP6a")[1].set(count);
return s;
}


