function maskQGC3()
{
	var s = new Set();
	var code = f("QGC1x1").domainValues();

	for(var i=0; i<code.length; i++)
	{
		if(f("QGC1x1")[code[i]].any('1','2','3','4') || f("QGC1x2")[code[i]].any('1','2','3','4'))
		{
			s.add(code[i]);
		}
	}

	return s;
}

