function maskQFP3bx1()
{
var s = new Set();
s = a("QFP3bx1");
var count =4 ;

if(f("QFD5b")[1].any('1'))
{
s= s.diff(set(1,4,7,10,13,16));
count--;
}

if(f("QFD5b")[2].any('1'))
{
s= s.diff(set(2,5,8,11,14,17));
count--;
}

if(!f("Hidlaunch").any('1') || f("QFD5b")[3].any('1'))
{
s= s.diff(set(3,6,9,12,15,18));
count--;
