function maskQFC6()
{
	var s = new Set();
	var code = f("QFC5x1").domainValues();

	for(var i=0; i<code.length; i++)
	{
		if(f("QFC5x1")[code[i]].any('1','2','3','4') || f("QFC5x2")[code[i]].any('1','2','3','4'))
		{
			s.add(code[i]);
		}
	}

	return s;
}

