function QLOI_Time_Duration(startqid,endqid,dura)
{
	var dtstart=new Date();
	var dtend=new Date();

	dtstart=f(startqid).get();
	dtend=f(endqid).get();

	//var dtstartmilisec=dtstart.getTime();
	var dtstartmilisec=Date.parse(dtstart);
	//var dtendmilisec=dtend.getTime();
	var dtendmilisec=Date.parse(dtend);

	var diffmilisec=dtendmilisec-dtstartmilisec;
	var diffsec=diffmilisec/1000;

	var difftime=diffsec/60;

	//f(dura).set(difftime);
	return difftime;

	//Response.Write("start date: "+dtstart);
	//Response.Write("end date: "+dtend);

	//Response.Write("start date milisecond: "+dtstartmilisec);
	//Response.Write("end date milisecond: "+dtendmilisec);

	//Response.Write("diff milisecond: "+diffmilisec);
	//Response.Write("diff in sec: "+diffsec);
}

function fLOI()
{
	var pre=f('QLOI_start').domainValues();
	var qid=CurrentForm();
	var available_loops=f('hLoopList').domainValues();

	for(var i=1;i<available_loops.length;i++)
	{
		if(f(available_loops[i]).isect(nset(999999)).size()>0)
		{
			qid=qid+"_"+f(available_loops[i]).get();
			break;
		}
	}

	for(var i=0;i<pre.length;i++)
	{
		if(pre[i]==qid)
		{
			if(!f('QLOI_start_'+qid).toBoolean()) { Time_Start("QLOI_start_"+qid+""); }
		}
	}

	if(f('hPrevious').toBoolean())
	{
		var t=QLOI_Time_Duration("QLOI_start_"+f('hPrevious').get()+"","QLOI_start_"+qid+"","QLOI_duration_"+f('hPrevious').get()+"")
		var t1=f('hPrevious').get();
		if(f('hPrevious').get()!=qid)
		{
			f('QLOI_duration_'+t1).set(t);
		}
	}
	//Response.Write(t);

	for(var i=0;i<pre.length;i++)
	{
		if(pre[i]==qid)
		{
				f('hPrevious').set(qid);
		}
	}
}


if(f('hPrevious').toBoolean())
{
     Time_Duration("QLOI_start_"+f('hPrevious').get()+"","QLOI_duration_"+f('hPrevious').get()+"");
}

function feedback(lcode)
{
	var cfeedback=Request("cfeedback");
	var tfeedback=Request("tfeedback");
                var qid=lcode.length>0?CurrentForm()+""+lcode:CurrentForm();

	if(a("drfeedback").isect(set(qid)).size()>0 && (cfeedback.length>0 || tfeedback.length>0))
	{
	f("drfeedback")[qid].set(cfeedback);
	f("dtfeedback")[qid].set(tfeedback);
	}

}

