function MutualWstr4(qid1,qid2)
{
      if(f(qid1).toBoolean() && f(qid2).toBoolean())
      {
                    RaiseError();
                    ClearErrorMessage();
                    ClearQuestionErrorMessage();
                    //SetErrorMessage(LangIDs.en,"Please do not check the option "+str+" if you enter any other responses.");
                    var pre=f(qid2).domainValues();
                    AppendErrorMessage(CurrentLang(),""+f('ErrorMessage')[23].label()+" «"+f(qid2)[pre[0]].label()+"» "+f('ErrorMessage')[24].label()+"");
                    ClearForm(f(qid1));
                    ClearForm(f(qid2));
                    return;

      }

      if(!f(qid1).toBoolean() && !f(qid2).toBoolean())
      {
                    RaiseError();
                    //ClearErrorMessage();
                    //ClearQuestionErrorMessage();
                    //SetErrorMessage(LangIDs.en,"Please provide an answer.");
                    //return;
                    AppendErrorMessage(CurrentLang(),""+f('ErrorMessage')[58].label()+" «"+f(qid1).text()+"».");

      }

}

function isRDG(qid,sVals)
{
if(IsInRdgMode())
{
ClearForm(f(qid))
if(sVals>0)
{
var val=sVals;
var codes=f(qid).domainValues();
for(var i=0;i<codes.length;i++)
{
var pval=Math.ceil(val*Math.random())
if(pval>0)
{
f(qid)[codes[i]].set(pval);
val=val-pval;
}
else
{
f(qid)[codes[i]].set(0);
}
}

}
else if(f(qid).getType()=='NUMERIC' || f(qid).getType()=='CODED')
{
var arr=sVals.members();
var index=Math.floor(arr.length*Math.random())
if(!isNaN(arr[index]))
f(qid).set(arr[index])
}
else if(f(qid).getType()=='COMPOUND')
{
var arr=sVals.members();
var noVals=Math.floor(arr.length*Math.random())
for(var i=noVals;i>=0;i--)
{
if(a(qid).isect(set(arr[i])).size()>0)
f(qid)[arr[i]].set(1)
}
}

}
else
return false;
}

function capturesurveylink()
{
	var current_status=GetStatus();

	var finallink="";
	var currentquestion=CurrentForm();
	if(current_status=='')
	{
		f('LastAnswered').set(currentquestion);
	}
	if(current_status=='complete')
	{
		f('LastAnswered').set("LastInfo");
	}

	finallink+=GetRespondentUrl(currentquestion);
	f('Link').set(finallink);
               // f("txt1").set(Request('txt1'));
}

function Valid(qid)
{
	var codes = f(qid).domainValues();

	for(var i=0; i<codes.length; i++)
	{
		var code = codes[i];
		if(!f(qid)[code].toBoolean())
		{
			CallError(12);
		}
	}
}

//qid  --->question id
//low  --->lower range
//high  --->higher range
//This function we can use for numeric questions, for dynamic ranges

function inRange(qid,low,high,msg)
{
	var c=0;
	if(f(qid).getType()=="COMPOUND" && !QuestionErrors())
	{
		var codes=f(qid).categories();
		for(var i=0;i<codes.length;i++)
		{
			if(!InRange(f(qid)[codes[i]].get(),low,high))
			{
				c++;
				break;
			}
		}
	}
else if(f(qid).getType()=="NUMERIC" && !QuestionErrors())
{
	if(!InRange(f(qid).get(),low,high))
	{
		c++;
	}
}
if(c>0)
{
	RaiseError();
	if(msg.length>0)
	{
