function PipeMultiWithOtherSpecify(Qid, Ocode)
{

/*
Qid == Question ID of base Question
OCode == "precode" of Other Specify 
*/


	var str=new String();
	var pre=f(Qid).categories();

	for(var i=0;i<pre.length;i++)
	{
		var l=pre.length

		if(f(Qid)[Ocode].get()=='1')
		{
			l=l-1;
		}

		if(pre[i]!=Ocode )
		{
			str=str+f(Qid)[pre[i]].label();
		}

		if(i<l-1)
		{

			if(f(Qid)[Ocode].get()=='0' && i==l-2)
			{
			str=str+" and "
			}
			else
			{
			str=str+", "
			}

		}

	}

if(f(Qid)[Ocode].get()=='1' && pre.length>1)
{
str=str+" and "+f(Qid+"_"+Ocode+"_other")
}
if(f(Qid)[Ocode].get()=='1' && pre.length==1)
{
str=str+f(Qid+"_"+Ocode+"_other")
}

return str
}

function checkSum(Operator,val,msg)
{

        if(f(CurrentForm()).toBoolean() && !QuestionErrors())
         {
	var vals=val;
                var msg1=msg.length>0?vals+""+f('ErrorMessage')[25].label()+"&laquo;"+msg+"&raquo;.":vals+"." ;
                if(Operator=="<" && Sum(f(CurrentForm()).values())>=vals)            SQEM(f('ErrorMessage')[101].label()+" "+msg1);
                else if(Operator=="<=" && Sum(f(CurrentForm()).values())>vals)     SQEM(f('ErrorMessage')[102].label()+" "+msg1);
                else if(Operator==">" && Sum(f(CurrentForm()).values())<=vals)     SQEM(f('ErrorMessage')[103].label()+" "+msg1);
                else if(Operator==">=" && Sum(f(CurrentForm()).values())<vals)     SQEM(f('ErrorMessage')[104].label()+" "+msg1);
                else if(Operator=="==" && Sum(f(CurrentForm()).values())!=vals)    SQEM(f('ErrorMessage')[105].label()+" "+msg1);
                else if(Operator=="!=" && Sum(f(CurrentForm()).values())==vals)    SQEM(f('ErrorMessage')[106].label()+" "+msg1);

          }
         else if(!f(CurrentForm()).toBoolean() && !QuestionErrors())
          {   
              SQEM(f('ErrorMessage')[1].label())
          }
}

