function autopunchdata(qid1,qid2)
{
  var code = f(qid1).categories();

  for( var i=0; i<code.length; i++ )
 {
    if( f(qid1)[code[i]].toBoolean() )
   {
      f(qid2)[code[i]].set(f(qid1)[code[i]].get());
    }
  }
}


function autopunchdataNA(qid1,qid2,pre)
{
  var code = f(qid1).categories();
  f(qid2)[pre].set("NA")

  for( var i=0; i<code.length; i++ )
   {
    if( f(qid1)[code[i]].toBoolean() && pre!=code[i])
   {
      f(qid2)[code[i]].set(f(qid1)[code[i]].get());
    }
  }
}

function DateCheck(qid1,qid2)
{
	var mnth = f(qid1)[1].toNumber();
	var year = f(qid2)[1].toNumber();

	var current = new Date();
	var currentmonth = current.getMonth()+1;
	var currentyear = current.getFullYear();

	if((mnth > currentmonth && year > currentyear) || (mnth > currentmonth && year == currentyear))
	{
		CallError('77');
	}
}

