function LeastCountMulti(s,qid,quota,qid0)

 {

    var arr = s.members();

    var qcnt = new Array();

    var pre = new Array();

    var aval = new Array();

    var k=0;

    for ( var i=0;i<arr.length;i++ )

     {

        f(qid)[arr[i]].set('1');

        if ( !qf(quota) )

         {

            qcnt[k] = qc(quota);

                        f(qid0)[arr[i]].set(qcnt[k]);

            pre[k++] = arr[i];

          }

        f(qid)[arr[i]].set(null);

      }

    var selected = Min(qcnt);

    for ( var i=0,k=0;i<qcnt.length;i++ )

     {

        if ( qcnt[i] == selected )

            aval[k++] = pre[i];

     }

    var ranNum= Math.floor(Math.random()*aval.length);

    return aval[ranNum];

 }

/*********** Method to use 'LeastCountMulti' function ***********/

ClearForm(f('MLC'));

var pre = f('MLC').domainValues();
var s = new Set();
var Arr = new Array();

s = s.union(a('MLC'));

for(var i = 0; i < 2; i++) // Loop should be executed for number of answer options to be selected.
{
	var code = LeastCountMulti(s,"MLC","LQMulti","MLCOE");
	if(code>0)
	{
		Arr.push(code);
		s.remove(code);
	}

	if(s.size()==0)
	{
		break;
	}
}

for(var j=0; j<Arr.length; j++)
{
	f('MLC')[Arr[j]].set('1');
}

