/****7) Check blank spaces enter in open text box *****/

/*
Qid == Question ID
Type == Question type code as per below
         1 for Other specify
		 2 for open ended question
		 3 for multi open question
		 4 for multi open question which not having precodes in sequence.
OCode == It's Only for Type 1  pass the "precode" of Other Specify else pass zero (0)

*/

function CheckBlank(qid, type, Ocode)
{
	if(!QuestionErrors())
	{
		if( type == 1 )
		{
			if(f(qid).COMPOUND)
			{
				if( (f(qid+"_"+Ocode).toBoolean() && trim(f(qid+"_"+Ocode+"_other").get()) == '') || (trim1(f(qid+"_"+Ocode+"_other").get()).length <3 && f(qid+"_"+Ocode).toBoolean()))
				{
					//RaiseError();
					//AppendErrorMessage(LangIDs.en, "Please provide valid answer in the «Other (please specify)» box.");
					CallError(3);
				}
			}
			else
			{
				if( (f(qid).get()==Ocode && trim(f(qid+"_"+Ocode+"_other").get()) == '')  || (trim1(f(qid+"_"+Ocode+"_other").get()).length <3 && f(qid).get()==Ocode) )
				{
					//RaiseError();
					//AppendErrorMessage(LangIDs.en, "Please provide valid answer in the «Other (please specify)» box.");
					CallError(3);
				}
			}
		}
		else if( type == 2 )
		{
			if( (f(qid).toBoolean() && trim(f(qid).get()) == '' ) || (trim1(f(qid).get()).length<3 && f(qid).toBoolean()))
			{
				//RaiseError()
				//AppendErrorMessage(LangIDs.en, "Please provide valid answer in the box.");
				CallError(3);
			}
		}
		else if( type == 3 )
		{
			var precodes1=f(qid).categories();
			for(var i=0;i<precodes1.length;i++)
			{
				var code1=precodes1[i]
				if((trim(f(qid)[code1].get())=="" && f(qid)[code1].toBoolean()) || (trim1(f(qid)[code1].get()).length<3 && f(qid)[code1].toBoolean()))
				{
					RaiseError();
					//AppendErrorMessage(LangIDs.en, "Please provide valid answer in box "+code1+".")
					//f('ErrorMessage').set(4);
					AppendErrorMessage(CurrentLang(), " "+f('ErrorMessage')[4].label()+" "+code1+".");
				}
			}
		}
		else if( type == 4 )
		{
			var precodes1=f(qid).categories();
			for(var i=0;i<precodes1.length;i++)
			{
				var code1=precodes1[i]
				if((trim(f(qid)[code1].get())=="" && f(qid)[code1].toBoolean()) || (trim1(f(qid)[code1].get()).length<3 && f(qid)[code1].toBoolean()))
				{
					RaiseError();
					//AppendErrorMessage(LangIDs.en, "Please provide valid answer in box "+f(qid)[code1].label()+".")
					//f('ErrorMessage').set(4);
					AppendErrorMessage(CurrentLang(), " "+f('ErrorMessage')[4].label()+" "+f(qid)[code1].label()+".");
				}
			}
		}
	}
}

function fconsec(qid)
{
var precodes2=f(qid).domainValues();
var precodes1=f(qid).domainValues();
for(var i=1;i<=precodes2.length;i++)
{
 for(var j=i+1;j<=precodes1.length;j++)
 {
  if(f(qid)[j].toBoolean() && !f(qid)[i].toBoolean())
   {
           //RaiseError();
           //ClearQuestionErrorMessage();
          //SetErrorMessage(CurrentLang(),f('ErrorMessage')[113].label()); 
         CallError(113);
    }
  }
}
if(!f(qid).toBoolean())
{
   CallError(1);
}
}

