function fgridOtherN(qidset,gridId,other)
{
	var qids=new Array()
	qids=qidset.members()
	var c=0;
	var c1=0;                 
                var str=f(gridId+"_"+other+"_other").get();

	for(var i=0;i<qids.length;i++)
	{
		if(f(qids[i])[other].toNumber()>0) c1++;
	}
if(c1>0 || str.length>=1)
{	

               for(var i=0;i<qids.length;i++)
	{
		if(!f(qids[i])[other].toBoolean() || f(qids[i])[other].toNumber()==0) c++;
	}

	if( c==qidset.size() && f(gridId+"_"+other+"_other").toBoolean() )
	{
		//CallError('21');
		RaiseError();
		//SetErrorMessage(9,"Please make sure you enter a value greater than 0 for \"Other (Specify)\" if you specified it.");
		SetQuestionErrorMessage(CurrentLang(),f('ErrorMessage')[21].label()+f(qids[0])[other].label()+f('ErrorMessage')[22].label());
	}

	if(c<qidset.size() && !f(gridId+"_"+other+"_other").toBoolean())
	{
		//CallError('22');
		RaiseError();
		//SetErrorMessage(9,"Please make sure you specify your answer in \"Other (Specify)\" if you entered a value for that option.");
		SetQuestionErrorMessage(CurrentLang(),f('ErrorMessage')[26].label()+f(qids[0])[other].label()+f('ErrorMessage')[27].label());
	}

           checking(gridId,other)
}
}




















