		SetQuestionErrorMessage(9,"");
	}

  }

//msg ---> message

//this is the short form of SetQuestionErrorMessage

function SQEM(msg)
{
RaiseError();
SetQuestionErrorMessage(CurrentLang(),msg);
}

//qid          --->question id         eg:-Q1,Q2....

//codesSet  --->codesSet means scales set or set of numbers  eg:-set(1,2,3....) or nset(3) or nnset(1,10)  

//For Grid questions, if we need to check for which answer options scale 1, 2, 3 is selected use it this way : maskCodes(qid,codesSet); eg:-maskCodes("Q1",set(1,2,3));, here set(1,2,3) means scale preocdes, it will return all answer options where scale 1, 2, 3 is selected.

//For 3DGrid numeric, if we need check which answer options are having response greater than 10, then use it this way : maskCodes(qid,codesSet); eg:-maskCodes("Q1",nnset(11,100));, here nnset(11,100) is the response given by respondent and it will return answer options where this response is given.

function maskCodes(qid,codesSet)
{
var precodes=f(qid).domainValues()
var rcodes=new Set()
for(var i=0;i<precodes.length;i++)
   {
     if(set(f(qid)[precodes[i]]).isect(codesSet).size()>0) rcodes.add(precodes[i])
   }

return rcodes;
}

function clearDK(code)
{
var codes=maskCodes(CurrentForm(),set(code)).members();

for(var i=0;i<codes.length;i++)
{
f(CurrentForm())[codes[i]].set(null);
CallError(1);
}

}

function CopyMulti(from,to)
{
var precodes = f(from).categories();
for(var i : int = 0;i<precodes.length;++i)
{
var code = precodes[i];
f(to)[code].set(f(from)[code].get());
}
}

function MutualWstr(qid1,qid2)
{
      if(f(qid1).toBoolean() && f(qid2).toBoolean())
      {
                    RaiseError();
                    ClearErrorMessage();
                    ClearQuestionErrorMessage();
                    //SetErrorMessage(LangIDs.en,"Please do not check the option "+str+" if you enter any other responses.");
                    var pre=f(qid2).domainValues();
                    SetErrorMessage(CurrentLang(),""+f('ErrorMessage')[23].label()+" «"+f(qid2)[pre[0]].label()+"» "+f('ErrorMessage')[24].label()+"");
                    ClearForm(f(qid1));
                    ClearForm(f(qid2));
                    return;

      }

      if(!f(qid1).toBoolean() && !f(qid2).toBoolean())
      {
                    //RaiseError();
                    //ClearErrorMessage();
                    //ClearQuestionErrorMessage();
                    //SetErrorMessage(LangIDs.en,"Please provide an answer.");
                    //return;
                    CallErrorGrid(1)

      }

}
